import React from "react";
import {
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button
} from "reactstrap";

const Product = ({ item: { title, price, description, img } }) => {
  return (
    <Card>
      <CardImg
        top
        width="100%"
        //   src={require("../images/Header-Background.jpg")}
        src={require({ img })}
        alt="product"
      />
      <CardBody>
        <CardTitle>{title}</CardTitle>
        <CardSubtitle>Price: {price}</CardSubtitle>
        <CardText>{description}</CardText>
        <Button>Buy</Button>
      </CardBody>
    </Card>
  );
};

export default Product;
